import Foundation
import MapKit
import CloudKit
import os.log

class Station: FLODataEntity, Hashable {
    typealias `Self` = Station
    var hashValue: Int { return tradingName.hashValue }

    static func == (lhs: Station, rhs: Station) -> Bool {
        return lhs.tradingName == rhs.tradingName
    }

    static let calendar = Calendar.current

    enum Field: String {
        case address
        case brand
        case features
        case phone
        case stationDescription
        case suburb
        case location
        case latest
        case earliest
    }

    init(tradingName: String,
         brand: Brand,
         address: String?,
         latitude: Double,
         longitude: Double,
         phone: String?,
         stationDescription: String?,
         siteFeatures: Array<String>? = nil,
         suburb: Suburb? = nil)
    {
        self.tradingName = tradingName
        self.brand = brand
        self.address = address
        self.latitude = latitude
        self.longitude = longitude
        self.phone = phone
        self.stationDescription = stationDescription
        self.siteFeatures = siteFeatures
        self.suburb = suburb
    }

    init(record: CKRecord) {
        tradingName = Station.tradingName(from: record.recordID)
        address = record[Field.address.rawValue] as? String
        let location = record[Field.location.rawValue] as? CLLocation
        latitude = location?.coordinate.latitude ?? 0
        longitude = location?.coordinate.longitude ?? 0
        phone = record[Field.phone.rawValue] as? String
        stationDescription = record[Field.stationDescription.rawValue] as? String
        brand = Brand.all[Brand.ident(from: (record[Field.brand.rawValue] as! CKRecord.Reference).recordID)]
        suburb = Suburb.all[Suburb.ident(from: (record[Field.suburb.rawValue] as! CKRecord.Reference).recordID)]
        siteFeatures = record[Field.features.rawValue] as? Array<String>
        if let earliest = record[Field.earliest.rawValue] as? Date, let latest = record[Field.latest.rawValue] as? Date {
            dateRange = earliest ... Self.calendar.date(byAdding: .day, value: 7, to: latest)!
        }
        systemFields = Brand.archiveSystemFields(from: record)
    }

    public var address: String?
    public var latitude: Double
    public var longitude: Double
    public var phone: String?
    public var stationDescription: String?
    public var tradingName: String
    public var brand: Brand?
    public var priceOnDay: Set<PriceOnDay>?
    public var product: Set<Product>?
    public var siteFeatures: Array<String>?
    public var suburb: Suburb?
    public var systemFields: Data?
    public var dateRange: ClosedRange<Date>?

    fileprivate let logger = OSLog(subsystem: "com.nomdejoye.Fuel-Locator-OSX", category: "Station")

    var siteFeaturesList: String {
        return siteFeatures?.reduce("", { ($0 == "" ? $0 : $0 + ", ") + $1 }) ?? ""
    }

    var prices: [PriceOnDay] {
        return priceOnDay != nil ? Array<PriceOnDay>(priceOnDay!) : []
    }

    var products: [Product] {
        return product != nil ? Array<Product>(product!) : []
    }

    var coordinate: CLLocationCoordinate2D {
        get {
            return CLLocationCoordinate2D(latitude: latitude, longitude: longitude)
        }
        set {
            latitude = newValue.latitude
            longitude = newValue.longitude
        }
    }

    func prices(_ product: Product, date: Date) -> PriceOnDay! {
        return prices.filter{$0.product == product && $0.date as Date == date}.first
    }

    static let lock = NSObject()

    public var description: String {
        return "Station \(tradingName)"
    }

    public var debugDescription: String {
        return "Station (\(tradingName), \(String(describing: brand)), \(String(describing: suburb)))"
    }
    
    class func fetch(withIdent tradingName: String, _ completionBlock: @escaping (Station?, Error?) -> Void) {
        let pred = NSPredicate(format: "tradingName == %@", tradingName)
        let query = CKQuery(recordType: "FWStation", predicate: pred)

        do {
            Station.download(fromDatabase: try FLOCloud.shared.publicDatabase(), withQuery: query) { (error, records) in
                let stat: Station? = (records == nil || records!.isEmpty ? nil : Station(record: records!.first!))
                completionBlock(stat, error)
            }
        } catch {
            print("Error while submitting Station fetch (with block): \(error)")
        }
    }

    class func fetchAll(_ completionBlock: @escaping (Set<Station>, Error?) -> Void) {
        let predicate = NSPredicate(value: true)
        let query = CKQuery(recordType: "FWStation", predicate: predicate)

        do {
            Station.download(fromDatabase: try FLOCloud.shared.publicDatabase(), withQuery: query) { (error, records) in
                let stats = Set<Station>(records?.map({ Station(record: $0) }) ?? [])
                completionBlock(stats, error)
            }
        } catch {
            print("Error while submitting Station fetch: \(error)")
        }
    }

    static func fetchAll(with stations: [Station], _ completionBlock: @escaping (Set<Station>, Error?) -> Void) {}

    static var all = FLODataEntityAll<String, Station>()

    var key: String {
        return tradingName
    }

    class func tradingName(from recordID: CKRecord.ID) -> String {
        let str = recordID.recordName
        let index = str.index(after: str.index(of: ":")!)
        return String(str[index...])
    }

    class func recordId(from tradingName: String) -> CKRecord.ID {
        return CKRecord.ID(recordName: "Station:" + tradingName)
    }

    var recordID: CKRecord.ID {
        return Station.recordId(from: tradingName)
    }

    func hasChanged(from record: CKRecord) -> Bool {
        if let ad = record[Field.address.rawValue] as? String {
            if ad != address {
                return true
            }
        }
        if let br = record[Field.brand.rawValue] as? CKRecord.Reference {
            let brId = Brand.ident(from: br.recordID)
            if brId != brand?.ident {
                return true
            }
        }
        if let v = record[Field.suburb.rawValue] as? CKRecord.Reference {
            // Simply assert that this information won't change
            assert(suburb!.ident == Suburb.ident(from: v.recordID))
        }
        if let v = record[Field.location.rawValue] as? CLLocation {
            if v.coordinate.latitude != latitude || v.coordinate.longitude != longitude {
                return true
            }
        }
        if let ph = record[Field.phone.rawValue] as? String {
            if ph != phone {
                return true
            }
        }
        if let des = record[Field.stationDescription.rawValue] as? String {
            if des != stationDescription {
                return true
            }
        }
        if let features = record[Field.features.rawValue] as? Array<String> {
            for f in features {
                if !(siteFeatures?.contains(where: { $0 == f }) ?? false) {
                    return true
                }
            }
            if let sfs = siteFeatures {
                for sf in Array(sfs) {
                    if !features.contains(where: { $0 == sf }) {
                        return true
                    }
                }
            }
        }
        return false
    }

    var record: CKRecord {
        get {
            let r: CKRecord
            if systemFields == nil {
                r = CKRecord(recordType: "FWStation", recordID: Station.recordId(from: tradingName))
            } else {
                let unarchiver = NSKeyedUnarchiver(forReadingWith: systemFields!)
                unarchiver.requiresSecureCoding = true
                r = CKRecord(coder: unarchiver)!
            }
            if address != nil {
                r[Field.address.rawValue] = address! as NSString
            }
            if brand != nil {
                r[Field.brand.rawValue] = CKRecord.Reference.init(record: brand!.record, action: CKRecord.Reference.Action.none)
            }
            if siteFeatures != nil {
                r[Field.features.rawValue] = Array<String>(siteFeatures!.map({$0})) as NSArray
            }
            r[Field.location.rawValue] = CLLocation(latitude: latitude, longitude: longitude)
            if phone != nil {
                r[Field.phone.rawValue] = phone! as NSString
            }
            if stationDescription != nil {
                r[Field.stationDescription.rawValue] = stationDescription! as NSString
            }
            if suburb != nil {
                r[Field.suburb.rawValue] = CKRecord.Reference.init(record: suburb!.record, action: CKRecord.Reference.Action.none)
            }
            return r
        }
        set {
            systemFields = Station.archiveSystemFields(from: newValue)
            tradingName = Station.tradingName(from: newValue.recordID)
            if let ad = newValue[Field.address.rawValue] as? String {
                if ad != address {
                    address = ad
                }
            }
            if let br = newValue[Field.brand.rawValue] as? CKRecord.Reference {
                let brId = Brand.ident(from: br.recordID)
                if brId != brand?.ident {
                    let dg = DispatchGroup()
                    dg.enter()
                    Brand.fetch(withIdent: brId, { (br1, error) in
                        self.brand = br1
                        dg.leave()
                    })
                    _ = dg.wait(timeout: DispatchTime.now() + .seconds(4))
                }
            }
            if let v = newValue[Field.suburb.rawValue] as? CKRecord.Reference {
                // Simply assert that this information won't change
                assert(suburb!.ident == Suburb.ident(from: v.recordID))
            }
            if let v = newValue[Field.location.rawValue] as? CLLocation {
                if v.coordinate.latitude != latitude || v.coordinate.longitude != longitude {
                    latitude = v.coordinate.latitude
                    longitude = v.coordinate.longitude
                }
            }
            if let ph = newValue[Field.phone.rawValue] as? String {
                if ph != phone {
                    phone = ph
                }
            }
            if let des = newValue[Field.stationDescription.rawValue] as? String {
                if des != stationDescription {
                    stationDescription = des
                }
            }
            if let features = newValue[Field.features.rawValue] as? Array<String> {
                siteFeatures?.removeAll()
                siteFeatures?.append(contentsOf: features)
            }
        }
    }

    var initialiser: String {
        get {
            return """
                \(("\"" + tradingName + "\":").padding(toLength: 56, withPad: " ", startingAt: 0)) Station(tradingName: \"\(tradingName)\",
                                brand: \(brand != nil ? "Brand.all[" + brand!.ident.description + "]!" : "nil"),
                                address: \(address != nil ? "\"" + address! + "\"" : "nil"),
                                latitude: \(latitude != 0 ? latitude.description : "nil"),
                                longitude: \(longitude != 0 ? longitude.description : "nil"),
                                phone: \(phone != nil && !phone!.isEmpty ? "\"" + phone! + "\"" : "nil"),
                                stationDescription: \(stationDescription != nil ? "\"" + stationDescription! + "\"" : "nil"),
                                siteFeatures: \(siteFeatures != nil && !siteFeatures!.isEmpty ? "[" + siteFeatures!.map({"\"" + $0 + "\""}).joined(separator: ", ") + "]" : "nil"),
                                suburb: \(suburb != nil ? "Suburb.all[\"" + suburb!.ident + "\"]" : "nil"))
                """
        }
    }

